Prašymas
Suderinamas su "Fiat 500 Old Model 2" cilindru 130mm
Pin tipas: Plūduriuojantis Pin stūmoklis
Pranešimas: Kitos galimybės C / C: 118/120/124/126mm


Specifikacijos
* Tipas: kaltas 4340 orlaivių chromo moly kokybės plienas lenktynėms
* H spindulių Conrods kiekis: 2 gabalai, kaip rodoma paveikslėlyje
*Varžtai: įskaitant ARP 2000 5/16" varžtus (Pastaba: papildomos išlaidos atnaujinti į ARP L19 varžtus)
* Visi jungiamieji strypai apima ARP 2000 varžtus, kurie yra 220 000 psi, o pasirenkama ARP L19 medžiaga 260 000 psi yra prieinama kaip atnaujintas produktas.
* Reklamuojamas arklių galios įvertinimas: 200HP / gabalas
* Didžiausias pagreitis: 9000rpm
* pakuotės dydis: 20CM * 10CM * 7CM

Matmenys
Iš centro iki centro ilgis: 130mm / 5.118 "
Didelis galas skersmuo: 47.13mm / 1.856 "
Mažas galas skersmuo: 20mm / 0,787 "
Didelis galo plotis: 24,7 mm / 0,972 "
Mažas galo plotis: 18,5 mm / 0,728 "

Savybės
1. TÜV produkto bandymas ir TÜV ISO 9001 sertifikavimas;
2. Medžiaga: kaltas SAE 4340 Chrome Moly plienas, skirtas lenktynėms, siekiant aukščiausio stiprumo ir ilgaamžiškumo;
3. ARP 2000 varžtai, pasirenkami ARP L19 tvirtinimo elementai, prieinami kaip atnaujinimas;
4. H-Beam dizainas sumažina svorį, nepažeidžiant stiprumo;
5.Heat-apdorojimas & Shot-peened išliko nuoseklus ir stiprus. Shot-peened apdaila pašalinti potencialą streso didinimo;
6. Aukšto tikslumo CNC apdirbta, tikslumo strypas dangtelio suderinimo dėžutės;
7.Bores baigtas iki +/- .005mm;
8. subalansuotas iki +/- 1 g per strypas;
9. Kiekvienas strypas yra magnetinės dalelės išbandytas, kad būtų užtikrinta be trūkumų;
10.Naudokite rentgeno spindulių, garso išbandyta;
11.Custom aptarnavimas.


Pastaba
* Yra titano padengtų atnaujinimo modeliai;
* Profesionalus įrengimas labai rekomenduojamas;
* Custom Service: Jei mūsų svetainėje jums nereikia jokių konrodų, mes mielai padėsime nustatyti jūsų reikalavimus ir su jumis parengti sprendimą, kad patenkintumėte jūsų poreikius.

